SELECT COUNT(*) as agg_0 FROM "keyword" LEFT OUTER JOIN "movie_keyword" ON "keyword"."id" = "movie_keyword"."keyword_id" LEFT OUTER JOIN "title" ON "movie_keyword"."movie_id" = "title"."id"  WHERE "title"."title" NOT LIKE '%o%f%' AND "keyword"."phonetic_code" LIKE '%R%1652%' AND "keyword"."id" BETWEEN 17760 AND 46547 AND "title"."kind_id" BETWEEN 1 AND 7 AND "title"."id" >= 2093294;